import React, { useState } from 'react';

const FormComponent = () => {
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    tel: '',
    username: '',
    email: '',
    wilaya: '',
    type_sang: '',
    password: '',
    password_confirm: '',
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Ajoutez ici la logique pour soumettre les données
    console.log(formData);
  };

  return (
    <div className="max-w-lg mx-auto mt-8">
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label htmlFor="first_name">First Name:</label>
          <input
            type="text"
            id="first_name"
            name="first_name"
            value={formData.first_name}
            onChange={handleInputChange}
            className="w-full border-gray-300 rounded-md shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
          />
        </div>
        {/* Les autres champs input suivent le même modèle */}
        <div>
          <label htmlFor="wilaya">Wilaya:</label>
          <select
            id="wilaya"
            name="wilaya"
            value={formData.wilaya}
            onChange={handleInputChange}
            className="w-full border-gray-300 rounded-md shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
          >
            {/* Options pour le champ "wilaya" */}
            <option value="">Sélectionner une wilaya</option>
            <option value="wilaya1">Wilaya 1</option>
            <option value="wilaya2">Wilaya 2</option>
            {/* Ajoutez ici d'autres options depuis vos données Django */}
          </select>
        </div>
        <div>
          <label htmlFor="type_sang">Type Sang:</label>
          <select
            id="type_sang"
            name="type_sang"
            value={formData.type_sang}
            onChange={handleInputChange}
            className="w-full border-gray-300 rounded-md shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
          >
            {/* Options pour le champ "type_sang" */}
            <option value="">Sélectionner un type de sang</option>
            <option value="type1">Type 1</option>
            <option value="type2">Type 2</option>
            {/* Ajoutez ici d'autres options depuis vos données Django */}
          </select>
        </div>
        <div>
          <label htmlFor="password">Password:</label>
          <input
            type="password"
            id="password"
            name="password"
            value={formData.password}
            onChange={handleInputChange}
            className="w-full border-gray-300 rounded-md shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
          />
        </div>
        <div>
          <label htmlFor="password_confirm">Confirm Password:</label>
          <input
            type="password"
            id="password_confirm"
            name="password_confirm"
            value={formData.password_confirm}
            onChange={handleInputChange}
            className="w-full border-gray-300 rounded-md shadow-sm focus:border-indigo-300 focus:ring focus:ring-indigo-200 focus:ring-opacity-50"
          />
        </div>
        <div>
          <button
            type="submit"
            className="w-full bg-indigo-500 text-white py-2 px-4 rounded-md hover:bg-indigo-600 focus:outline-none focus:bg-indigo-600"
          >
            Submit
          </button>
        </div>
      </form>
    </div>
  );
};

export default FormComponent;
